('description_ar', '<h3>أنا محمد القاضي</h3><h3 style=\"text-align:right;\"><br /></h3><h2>أخصائي دعم فني ومطور برمجيات متكاملة</h2><p><br /></p><p style=\"text-align:right;\"><span style=\"font-family:Tahoma;\">مهندس دعم فني ماهر، يتمتع بخبرة واسعة في تقديم الدعم الفني الشامل للمستخدمين النهائيين وخدمة العملاء. أتقن تثبيت وترقية وتكوين التطبيقات المبتكرة على أنظمة تشغيل ويندوز، كما أقدّم الدعم الفني لتحسين سير العمل وتقليل انقطاعات الأعمال.</span></p>', '2025-08-20 18:14:59', '2025-08-20 18:14:59'),
('description_en', '<h2 style=\"margin-right:0px;margin-bottom:0px;margin-left:0px;padding:0px;border:none;\" class=\"h2\">I\'m Mohammed Al-Qadi</h2><p style=\"margin-right:0px;margin-bottom:0px;margin-left:0px;padding:0px;border:none;\"><br /></p><h2 class=\"h2\"><span class=\"tag\" style=\"margin:1rem 0px 0px;padding:0px;border:none;\">Technical Support Specialist &amp; Full Stack Developer</span></h2><h2 class=\"h2\"><span class=\"tag\" style=\"margin:1rem 0px 0px;padding:0px;border:none;\"><br /></span></h2><p><span style=\"font-size:1rem;\">Skilled Desktop Support Engineer with experience in providing comprehensive technical support to end users and customer services. Successful in installing, upgrading, and configuring innovative applications on Windows operating systems and providing technical support to optimize workflows and minimize business interruptions.</span></p>', '2025-08-20 18:14:59', '2025-08-24 20:47:52'),
('education_ar', '<h3>بكالوريوس العلوم: علوم الحاسوب وتكنولوجيا المعلومات</h3><p> كلية الهندسة وعلوم الحاسوب، جامعة إب</p><h4>٢٠١٧-٢٠٢٢ | باحث</h4>', '2025-08-20 18:14:59', '2025-08-20 18:14:59'),
